import React, { useState } from "react";
import { RiMenu3Line, RiCloseLine } from "react-icons/ri";
import { Link } from "react-router-dom";
import logo from "../../assets/Untitled (4).svg";

import "./navbar.css";

const Navbar = () => {
  const [toggleMenu, setToggleMenu] = useState(false);

  return (
    <div className="llm__navbar section__padding">
      <div className="llm__navbar-links">
        <div className="llm__navbar-links_logo">
          <a href="http://episum.com">
            <img src={logo} alt="logo" />
          </a>
        </div>
        <div className="llm__navbar-links_container">
          <p>
          {/* <a href="#home">Home</a> */}
          <Link to="https://episum.com/#home">Home</Link>
          </p>
          <p>
            {/* <a href="#about">About</a> */}
            <Link to="https://episum.com/#about">About</Link>
          </p>
          <p>
            {/* <a href="#features">Features</a> */}
            <Link to="https://episum.com/#features">Features</Link>
          </p>
          <p>
            {/* <a href="#pricing">Pricing</a> */}
            <Link to="https://episum.com/#pricing">Pricing</Link>
          </p>
          <p>
            {/* <a href="/#contact">Contact</a> */}
            <Link to="https://episum.com/#contact">Contact</Link>
          </p>
          <p className="dropdown">
            <Link>Product Lineage</Link>
            <div className="dropdown-content">
              <Link to="/insurance">
                <img src="../../assets/3775102.png" alt="" />
                Insurance
              </Link>
              <Link to="/diagnosticCenter">Diagnostic Center</Link>
            </div>
          </p>
        </div>
        <div className="llm__navbar-sign">
          {/* <p><a href="http://main.episum.com/login/">Log in</a></p> */}
          {/* <a href="http://main.episum.com/register/form">
          <button  type="button">Create Free</button>
            </a> */}
        </div>
      </div>
      <div className="llm__navbar-menu">
        {toggleMenu ? (
          <RiCloseLine
            color="#000000"
            size={30}
            onClick={() => setToggleMenu(false)}
          />
        ) : (
          <RiMenu3Line
            color="#000000"
            size={30}
            onClick={() => setToggleMenu(true)}
          />
        )}
        {toggleMenu && (
          <div className="llm__navbar-menu_container scale-up-center">
            <div className="llm__navbar-menu_container-links">
              <p>
                <Link to="https://episum.com/#home">Home</Link>
              </p>
              <p>
                <Link to="https://episum.com/#about">About</Link>
              </p>
              <p>
                {/* <a href="https://episum.com/#features">Features</a> */}
                <Link to="https://episum.com/#features">Features</Link>
              </p>
              <p>
                {/* <a href="https://episum.com/#pricing">Pricing</a> */}
                <Link to="https://episum.com/#pricing">Pricing</Link>
              </p>
              <p>
                {/* <a href="https://episum.com/#contact">Contact</a> */}
                <Link to="https://episum.com/#contact">Contact</Link>
              </p>
              <p className="dropdown">
                {/* <a href="#">Product Lineage</a> */}
                <div className="dropdown-content">
                  <Link to="/insurance">Insurance</Link>
                  <br />
                  <Link to="/diagonsticCenter">Diagnostic Center</Link>
                </div>
              </p>
            </div>
            {/* <div className="llm__navbar-menu_container-links-sign">
            <p><a href="http://main.episum.com/login/">Log in</a></p>
            <a href="http://main.episum.com/register/form">
          <button  type="button">Create Free</button>
            </a>
            </div> */}
          </div>
        )}
      </div>
    </div>
  );
};

export default Navbar;
